import React from 'react'

const NotificationBox = ({ response, responseCodes }) => {
    console.log(response)

    if (response){
        if (response.status === 409){
            return (
                <div>
                    hubo un error
                </div>    
            )
        }
        if (response.status === 201){
            return (
                <div>
                    todo bien...
                </div>
            )
        }
    }
    return null     

}

export default NotificationBox
